properties.DevelopmentDescription:
10 year permission for mixed use development of 27114sq.m. gross floor area comprising 15no. live/work units and 111 no. apartments (14216sq.m.),  retail/commercial (5288sq.m.),  offices (4986sq.m.),  creche (215sq.m.),  cafe/restaurant (558sq.m.) and ancillary areas (1851sq.m.) in 6 no. blocks ranging in height from 2 to 9 storeys all around a central public park (1500sq.m.) as follows:   Block B - 3 storey building (1993sq.m. gfa) comprising 2 no. ground floor retail units (579sq.m.) and associated signage with office accommodation (1150sq.m.) over and ancillary areas (264sq.m.);
Block C - 2 storey building (5620sq.m. gfa) comprising a supermarket at ground and first floor levels (4711sq.m.) incorporating convenience and comparison floor space,  off-licence sales area,  storage/staff/office areas,  service yard and ancillary areas,  cafe/restaurant at ground and first floor levels (358sq.m.) and all associated signage and ancillary areas (551sq.m.) all over basement car park incorporating 90 no. car parking spaces;
Block D - predominantly 7 storey building with a 9 and 5 storey elements (5085sq.m. gfa) comprising office (3836sq.m.) and ancillary areas (1249sq.m.) over basement car park incorporating 41 no. car parking spaces;
Block E - predominantly 7 storey building with 8 and 5 storey elements (10932sq.m.gfa) incorporating 12 no. live/work units,  75 no. 2 bed apartments and 12 no. 3 bed apartments with roof gardens at fifth (132sq.m.) and sixth (581sq.m.) floor levels and associated ancillary areas;
Block F - 4 to 5 storey building (3284sq.m. gfa) incorporating ground floor creche (215sq.m.) with associated external play area and 3 no. 2 bed live/work units,  20 no. 2 bed apartments, 4 no. 3 bed apartments with roof gardens at third (91sq.m.) and fifth (270sq.m.) floor levels and associated ancillary areas all over basement car park, extending below Block E and comprising 150 no. car parking spaces;
Block G - single story cafe/restaurant and all associaetd ancillary areas (200sq.m. gfa).
Permission is also sought for connection to public services,   ESB Substation,  totem signage (8m high and 2.3m wide),  landscaping/boundary treatments,  20 no. surface car parking spaces,  private balconies and ancillary site and development works with vehicular access/egress via the existing access from the Blessington Road.  The proposed development will also consist of amendments/modifications to existing surface car park serving Lidl comprising relocation of vehicular entrance on internal access road and reconfiguration of parking layout and landscaping.  The new Lidl car park provides a total of 148 no. car parking spaces.
All on lands (2.791ha) bounded by Blessington Road,  N81 Tallaght Bypass,  Priors Gate development and Bryan S. Ryan site.

